let select1 = getElementByXpath("/html/body/div[3]/div/div[2]/div[1]/div[5]/div[1]/select[1]");
let select2 = getElementByXpath("/html/body/div[3]/div/div[2]/div[1]/div[5]/div[1]/select[2]");

